import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import { AlgorandProvider } from './contexts/AlgorandContext';
import AlgorandTest from './components/AlgorandTest';
import './App.css';

function App() {
  return (
    <Router>
      <AlgorandProvider>
        <div className="App">
          <header className="App-header">
            <h1>SkillChain</h1>
          </header>
          <main>
            <AlgorandTest />
          </main>
        </div>
      </AlgorandProvider>
    </Router>
  );
}

export default App;
